    class MyProgressBar : ProgressBar //新建一个MyProgressBar类，它继承了ProgressBar的所有属性与方法
    {
        //public double Value { get; set; }
        public MyProgressBar()
        {
            base.SetStyle(ControlStyles.UserPaint, true);//使控件可由用户自由重绘
        }
        protected override void OnPaint(PaintEventArgs e)
        {
            Rectangle bounds = new Rectangle(0, 0, base.Width, base.Height);
            e.Graphics.FillRectangle(new SolidBrush(this.BackColor), 0, 0, bounds.Width, bounds.Height);//此处完成背景重绘，并且按照属性中的BackColor设置背景色
            bounds.Width = ((int)(bounds.Width * (((double)base.Value) / ((double)base.Maximum))));//是的进度条跟着ProgressBar.Value值变化
            e.Graphics.FillRectangle(new SolidBrush(this.ForeColor), 0, 0, bounds.Width, bounds.Height);//此处完成前景重绘，依旧按照Progressbar的属性设置前景色
        }
    }
